// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import { useAuth0 } from '@auth0/auth0-react'; // Importar useAuth0 para gestionar la autenticaci贸n

const Header = () => {
  const { isAuthenticated } = useAuth0(); // Obtener el estado de autenticaci贸n

  return (
    <header className="header">
      <nav>
        <ul className="nav-list">
          <li className="nav-item"><Link to="/" className="nav-link">Home</Link></li>
          <li className="nav-item"><Link to="/service" className="nav-link">Service</Link></li>
          <li className="nav-item"><Link to="/recipes" className="nav-link">Recipes</Link></li>
          <li className="nav-item"><Link to="/restaurants" className="nav-link">Restaurants</Link></li>
        </ul>
      </nav>
      <div className="auth-buttons">
        {isAuthenticated ? (
          <>
            <Profile />
            <LogoutButton />
          </>
        ) : (
          <LoginButton />
        )}
      </div>
    </header>
  );
};

export default Header;
